import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput');

    // XSS payload
    const xssPayload = `"><img src=x onerror=alert('XSS')>`;

    // Type the XSS payload into the search input
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after entering payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Wait for the search button (try several selector strategies)
    let searchBtn = await page.$('.search-btn');
    if (!searchBtn) {
      searchBtn = await page.$('button:has-text("Search")');
    }
    // Click the first visible search button
    const searchBtns = await page.$$('.search-btn');
    let clicked = false;
    for (const btn of searchBtns) {
      if (await btn.isVisible()) {
        await btn.click();
        clicked = true;
        break;
      }
    }
    if (!clicked && searchBtn) {
      await searchBtn.click();
    }

    // Wait for possible dynamic content or navigation
    await page.waitForTimeout(1200);

    // Take screenshot after search submit
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submit.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submit.png'));

    // Check if the payload is reflected in the DOM (possible XSS)
    let reflected = false;
    let imgFound = false;
    let alertTriggered = false;

    // Check for reflected payload in the page content
    const pageContent = await page.content();
    if (pageContent.includes(xssPayload)) {
      reflected = true;
    }

    // Check if an <img> tag with src=x exists (our payload)
    const imgElements = await page.$$('img[src="x"]');
    if (imgElements.length > 0) {
      imgFound = true;
    }

    // Try to detect if an alert was triggered (Playwright auto-handles dialogs, so we can't catch it)
    // But we can check for side effects, e.g., if the DOM contains our payload as HTML (not escaped)
    // We'll also check if the suggestion box or results contain our payload as HTML (not as text)
    let xssInSuggestion = false;
    const suggestionBox = await page.$('#searchSuggestions');
    if (suggestionBox) {
      const suggestionHtml = await suggestionBox.innerHTML();
      if (suggestionHtml.includes('<img src=x')) {
        xssInSuggestion = true;
      }
    }

    // Also check for the payload in the main content area
    let xssInMainContent = false;
    const mainContent = await page.$('#mainContent');
    if (mainContent) {
      const mainHtml = await mainContent.innerHTML();
      if (mainHtml.includes('<img src=x')) {
        xssInMainContent = true;
      }
    }

    return {
      success: true,
      action: "Attempted XSS via search input and checked for payload reflection and execution.",
      extractedData: {
        payload: xssPayload,
        reflected,
        imgFound,
        xssInSuggestion,
        xssInMainContent,
        alertTriggered // always false due to Playwright auto-handling
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
